document.addEventListener('DOMContentLoaded', () => {
    const menuBtn = document.getElementById('menu-btn');
    const nav = document.querySelector('nav');

    menuBtn.addEventListener('click', () => {
        nav.classList.toggle('active'); // Toggle the 'active' class on the nav
        menuBtn.classList.toggle('active'); // Toggle the active class on the button
    });

    // Optional: Close the menu when a link is clicked (for small screens)
    const navLinks = document.querySelectorAll('nav a');
    navLinks.forEach(link => {
        link.addEventListener('click', () => {
            nav.classList.remove('active'); // Remove the 'active' class
            menuBtn.classList.remove('active'); // Remove the 'active' class from the button
        });
    });
});
document.addEventListener("DOMContentLoaded", function() {
    const navLinks = document.querySelectorAll("nav a");
    
    navLinks.forEach(link => {
        link.addEventListener("mouseover", function() {
            this.style.color = "#ced4da";
        });
        link.addEventListener("mouseout", function() {
            this.style.color = "#f8f9fa";
        });
    });

    function storeVisit() {
        let visitCount = localStorage.getItem("visitCount") || 0;
        visitCount++;
        localStorage.setItem("visitCount", visitCount);
        console.log(`You have visited this site ${visitCount} times.`);
    }
    storeVisit();
});

