// Function to generate tourist site cards
document.addEventListener("DOMContentLoaded", function() {
    const container = document.getElementById("sites-container");
    
    touristSites.forEach(site => {
        const card = document.createElement("div");
        card.classList.add("site-card");
        
        const name = document.createElement("h3");
        name.textContent = site.siteName;
        
        const location = document.createElement("p");
        location.textContent = `Location: ${site.location}`;
        
        const established = document.createElement("p");
        established.textContent = `Established: ${site.established}`;
        
        const area = document.createElement("p");
        area.textContent = `Area: ${site.area.toLocaleString()} sq km`;
        
        const link = document.createElement("a");
        link.href = site.detailsUrl;
        link.target = "_blank";
        
        const image = document.createElement("img");
        image.src = site.imageUrl;
        image.alt = site.siteName;
        image.loading = "lazy";
        
        link.appendChild(image);
        card.appendChild(name);
        card.appendChild(location);
        card.appendChild(established);
        card.appendChild(area);
        card.appendChild(link);
        
        container.appendChild(card);
    });
});
